import './App.css';
import DrumMachine from './components/DrumMachine';
import Display from './components/Display';
import DrumPad from './components/DrumPad';

function App() {
  return (
    <div className="App">
      <DrumMachine >
        <Display  />
        <DrumPad buttonName="Q" audioName="Heater 1" />
        <DrumPad buttonName="W" audioName="Heater 2" />
        <DrumPad buttonName="E" audioName="Heater 3" />
        <DrumPad buttonName="A" audioName="Heater 4" />
        <DrumPad buttonName="S" audioName="Clap" />
        <DrumPad buttonName="D" audioName="Open-HH" />
        <DrumPad buttonName="Z" audioName="Kick-n'-Hat" />
        <DrumPad buttonName="X" audioName="Kick" />
        <DrumPad buttonName="C" audioName="Closed-HH" />
      </DrumMachine>
    </div>
  );
}

export default App;
